import React from "react";

function Wait(props) {
  return (
    <div className="text-center page-center">
      <h2>Espera pelo início do jogo!</h2>
      <div className="mt-4"></div>
      <h4>Estás em {props.rank}º lugar</h4>
      <h5>
        Tens {props.points} ponto{props.points !== 1 && "s"}
      </h5>
    </div>
  );
}

export default Wait;
